import java.net.HttpURLConnection;
import java.net.URL;
import java.net.URLEncoder;
import java.util.ArrayList;
import java.util.Scanner;

public class TryOn {
    
    private ArrayList<String> input;
    private String imgPer;

    public String executePost(String person, String clothing, String ID, String test, String host) throws UnsupportedEncodingException {
        HttpURLConnection connection = null;
        String params = URLEncoder.encode("person", "UTF-8")
                + "=" + URLEncoder.encode(person, "UTF-8");
        params += "&" + URLEncoder.encode("clothing", "UTF-8")
                + "=" + URLEncoder.encode(clothing, "UTF-8");
        params += "&" + URLEncoder.encode("ID", "UTF-8")
                + "=" + URLEncoder.encode(ID, "UTF-8");
        params += "&" + URLEncoder.encode("test", "UTF-8")
                + "=" + URLEncoder.encode(test, "UTF-8");
        try {
            //Create connection
            URL url = new URL("http://" + host + "/test");
            connection = (HttpURLConnection) url.openConnection();
            connection.setRequestMethod("POST");
            connection.setRequestProperty("Content-Type",
                    "application/x-www-form-urlencoded");

            connection.setRequestProperty("Content-Length",
                    Integer.toString(params.getBytes().length));
            connection.setRequestProperty("Content-Language", "en-US");

            connection.setUseCaches(false);
            connection.setDoOutput(true);
            connection.setConnectTimeout(100000);
            connection.setReadTimeout(100000);
            //Send request
            DataOutputStream wr = new DataOutputStream(
                    connection.getOutputStream());
            wr.writeBytes(params);
            wr.close();

            //Get Response  
            InputStream is = connection.getInputStream();
            BufferedReader rd = new BufferedReader(new InputStreamReader(is));
            StringBuilder response = new StringBuilder(); // or StringBuffer if Java version 5+
            String line;
            while ((line = rd.readLine()) != null) {
                response.append(line);
                response.append('\r');
            }
            rd.close();
            return response.toString();
        } catch (Exception e) {
            e.printStackTrace();
            return null;
        } finally {
            if (connection != null) {
                connection.disconnect();
            }
        }
    }

    public TryOn() {
        input = new ArrayList<String>();
        String tmp1 = "";
        String tmp2 = "";
        String tmp3 = "";
        String img = "";
        input.add(" ");
        input.add("");
        input.add("");
        input.add("");
        input.add("");
        input.add("");
        input.add("");
        input.add("");
        input.add(tmp1 + tmp2 + tmp3);
        input.add("");
        imgPer = "";
    }

    public String tryOn(int imgIndex) {
        String output = "";
        try {
            System.out.println(imgPer);
            System.out.println(input.get(imgIndex));
            output = executePost(imgPer, input.get(imgIndex), Integer.toString(imgIndex), "F", "127.0.0.1:8000");
        } catch (UnsupportedEncodingException e) {
            e.printStackTrace();
        }
        return output;
    }

}